import React from "react";

function Login(props) {
  const test = () => {
    console.log(props.isVisible);
  }
  return(
    <div style={{visibility: props.isVisible ? "visible" : "hidden"}} onClick={test} className="user-form">
      <h1>Hello world</h1>
    </div>
  )
}

export default Login;
